.comments {
  display: block;
  max-width: 280px;
  margin-bottom: 30px;
  margin-left: auto;
  margin-right: auto;
  padding-bottom: 86px;

  @media screen and (min-width: 320px) {
    max-width: 620px;
  }
  @media screen and (min-width: 768px) {
    min-width: 620px;
    margin-bottom: 35px;
    padding-bottom: 119px;
  }
  @media screen and (min-width: 1200px) {
    max-width: 926px;
    padding-bottom: 132px;
  }
}

.rev_slider {
  padding-top: 80px;
  text-align: center;
}

.slider img {
  margin-bottom: 30px;
  margin-left: auto;
  margin-right: auto;

  @media screen and (min-width: 1200px) {
    margin-bottom: 20px;
  }

  @media screen and (min-width: 1200px) {
    margin-bottom: 15px;
  }
}

.comment-box {
  background-color: $bg-comment;
  position: relative;
  text-align: center;
  max-width: 100%;
  height: 308px;
  margin-bottom: 30px;
  padding: 43px 50px 24px 60px;

  @media screen and (min-width: 768px) {
    width: 620px;
    height: 165px;
    margin-bottom: 24px;
    padding-top: 50px;
    padding-left: 80px;
  }

  @media screen and (min-width: 1200px) {
    width: 936px;
    height: 140px;
    margin-bottom: 15px;
    // padding: 47px 89px 39px 87px;
  }
}

.comments-text {
  width: 180px;
  display: block;
  position: absolute;
  padding-left: 10px;
  padding-right: 10px;
  color: $black;
  font-style: normal;
  font-weight: 500;
  font-size: 12px;
  line-height: 31px;
  letter-spacing: 0.04em;
  z-index: 10;

  background: repeating-linear-gradient(
    to bottom,
    $border-color 0px,
    transparent 1px,
    transparent 30px,
    $border-color 30px,
    $border-color 31px
  );
  background-position: center bottom 3px;

  @media screen and (min-width: 768px) {
    width: 460px;
    // padding-right: 30px;
    font-size: 14px;
    line-height: 30px;
  }
  @media screen and (min-width: 1200px) {
    width: 750px;
    font-size: 16px;
  }
}
.quotes {
  position: absolute;
  top: 28px;
  left: 65px;
  z-index: 1;

  @media screen and (min-width: 768px) {
    top: 30px;
    left: 40px;
  }

  @media screen and (min-width: 768px) {
    top: 32px;
    left: 50px;
  }
}

.circle-list {
  display: flex;
  justify-content: center;
  margin-bottom: 18px;
}

.circle-item {
  display: block;
  width: 4px;
  height: 4px;
  border-radius: 50%;
  background-color: $bc-comment;

  &:not(:last-child) {
    margin-right: 10px;
  }
}

.comment-icon {
  display: flex;
  justify-content: center;
  margin-bottom: 20px;
}

.comments-location {
  color: $black;
  font-style: normal;
  font-weight: 500;
  font-size: 14px;
  line-height: 1.85;

  @media screen and (min-width: 768px) {
    font-size: 16px;
  }
  @media screen and (min-width: 1200px) {
    font-size: 20px;
  }
}

.slick-dotted.slick-slider {
  margin-bottom: 30px;
}

.slick-dots {
  position: absolute;
  bottom: -80px;

  display: block;

  width: 100%;
  padding: 0;
  margin: 0;

  list-style: none;

  text-align: center;

  height: 70px;
}

.slick-dots li {
  position: relative;

  display: inline-block;

  width: 20px;
  height: 20px;
  margin: 0 5px;
  padding: 0;

  cursor: pointer;
}

.slick-dots li button {
  font-size: 0;
  line-height: 0;

  display: block;

  width: 20px;
  height: 20px;
  padding: 5px;

  cursor: pointer;

  color: transparent;
  border: 0;
  outline: none;
  background: transparent;
}

.slick-dots li button:hover,
.slick-dots li button:focus {
  outline: none;
}

.slick-dots li button:hover:before,
.slick-dots li button:focus:before {
  color: $primary-text-pink;
  opacity: 0.6;
}

.slick-dots li button:before {
  font-family: 'slick';
  font-size: 12px;
  line-height: 20px;

  position: absolute;
  top: 0;
  left: 0;

  width: 20px;
  height: 20px;

  content: '•';
  text-align: center;

  opacity: 0.15;

  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
}

.slick-dots li.slick-active button:before {
  content: url('../image/comment-section/home.svg');
  opacity: 0.8;
  color: $primary-text-pink;
}

