.contacts-card {
    display: block;
    margin-bottom: 20px;
    padding: 43px 21px 43px 20px;
    width: 220px;
    height: 427px;
    font-family: $font-contacts;
    font-size: 12px;

    background-color: $white;
    border-radius: 24px;
    box-shadow: 0px 8px 30px rgba(212, 20, 67, 0.1);
    transform: scale(1);


    &:first-child {
        margin-top: -84px;
    }

    @media screen and (max-width: 767px) {
        &:last-child {
            margin-bottom: 54px;
        }
