.monday {
    position: relative;
    margin-top: 50px;

    &::before {
        position: absolute;
        top: -25px;
        display: block;
        align-content: flex-start;
        content: "";
        width: 179px;
        height: 1px;
        border-radius: 2px;
        background-color: $border-color;

        @media screen and (min-width: 768px) {
            width: 157px;
        }
        @media screen and (min-width: 1200px) {
            width: 234px;
        }
    }
    & p:last-child {
        margin-bottom: 10px;
        
        @media screen and (min-width: 768px) {
            margin-bottom: 16px;
        }
        @media screen and (min-width: 1200px) {
            margin-bottom: 15px;
        }
    }
}

.weekend {
    position: relative;
    margin: 0;

    & p:last-child {
        margin-bottom: 25px;
    }

    &::after {
        display: block;
        align-content: center;
        content: "";

        width: 179px;
        height: 1px;
        border-radius: 2px;
        background-color: $border-color;

        @media screen and (min-width: 768px) {
            width: 157px;
        }
        @media screen and (min-width: 1200px) {
            width: 234px;
        }
    }    
}
.contacts-address {
    margin-top: 25px;
    font-weight: 500;

    @media screen and (min-width: 768px) {
        margin-top: 30px;
    }
    @media screen and (min-width: 1200px) {
        margin-top: 32px;
    }

    & a {        
        font-family: $font-contacts;
        font-style: normal;
        font-size: 12px;
        line-height: 1.5;

        color: $primary-text-color;

        @media screen and (min-width: 768px) {
            font-size: 14px;
            line-height: 1.83;
        }
        @media screen and (min-width: 1200px) {
            font-size: 16px;
            line-height: 1.83;        }
    }
}

/* BUTTONS */
.contact-buttons {
    display: flex;
    flex-direction: column;
    align-items: center;

    @media screen and (min-width: 768px) {
        display: flex;
        flex-direction: row;
        align-items: baseline;
        justify-content: center;
    }

    @media screen and (min-width: 1200px) {
        display: flex;
        flex-direction: row;
        align-items: baseline;
        justify-content: center;
    }
}

.contacts-link {
    display: flex;
    align-items: center;
    justify-content: center;
    text-align: center;    
    margin: 0;
    width: 161px;
    height: 44px;
    border-radius: 22px;
    // transform: scale(1);

    cursor: pointer;
    
    & .contacts-button {
        font-family: $font-contacts;
        font-weight: 700;
        font-size: 16px;
        line-height: 1.3;
    }

    & .contacts-arrow {
        margin-left: 8px;
        width: 8px;
        height: 8px;
    }
}
.red {        
    margin-bottom: 10px;
    color: $white;
    background: #D41342;

    & .contacts-arrow {
        fill: currentColor;
    }

    @media screen and (min-width: 768px) {
        width: 191.45px;
        margin-right: 14.5px;
    }
    @media screen and (min-width: 1200px) {
        width: 198px;
        margin-right: 15px;

        // &:hover,
        // &:focus {
        //     transform: scale(1.05);
        // }
    }
}
.white {
    color: $primary-text-pink;
    background-color: $white;

    & .contacts-arrow {
        fill: currentColor;
    }

    @media screen and (min-width: 768px) {
        width: 174px;
        margin-right: 14.5px;
    }
    @media screen and (min-width: 1200px) {
        width: 180px;
        margin-right: 15px;
    }
    
    &:hover,
    &:focus {
        color: $primary-text-pink;
        background-color: $btn-hover-bg-color;
        // transform: scale(1.05);
    }
}

